import React from 'react'
import {NavLink,Link} from 'react-router-dom'
export const CarriedOutList = ({carriedouts}) =>{
    if(!carriedouts.length){
        return <p className="center">Немає виконаних завдань</p>
    }
    
    return(
        <div>
            <table>
                <thead>
                    <tr>
                        <td>Email</td>
                        <td>Task</td>
                        <td>Answer</td>
                        <td>Estimate</td>
                        <td>Checked</td>
                        <td>Link</td>
                    </tr>
                        
                </thead>
                <tbody>
                    {carriedouts.map(carriedout => {
                        return(
                            <tr>
                                <td>{carriedout.decisiveuseremail}</td>
                                
                                <td>{carriedout.task}</td>
                                <td>{carriedout.text}</td>
                                <td><div style={{
                                    width:"50px", height:"50px", borderRadius:"50%", backgroundColor: carriedout.estimate?"green":"red"
                                }} /></td>
                                <td><div style={{
                                    width:"50px", height:"50px", borderRadius:"50%", backgroundColor: carriedout.checked?"green":"red"
                                }} /></td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>
        </div>
    )
}
